import './styles.sass';

import Header from '../Header';
import Footer from '../Footer';
import Body from '../Body';
import Carousel from '../Slides'
import Carro from '/'

const Index = () => {
  return (
    <>
      <Header />
      <Body />
      <Carousel />
      <carro />
      <Footer />
    </>
  )
}

export default Index;
